var app = angular.module('Minuta4j',[]);

minuta4j.hostWebServices = 'http://minuta4j.herokuapp.com/api/';

if (!sessionStorage['minuta4j.userName'] && location.hreg && location.hreg.indexOf('index.html') < 0) {
	location.href = 'index.html';
}

$(window).load(function() {
	$('.date').pickadate();
});

// OpenDropdown
$(document).on('click', '.dropdown-open', function(e){
	e.preventDefault();

	$(this).parent().find('.dropdown').slideDown();
	$(this).parent().find('i').removeClass('ss-navigatedown').addClass('ss-navigateup');
});

// CloseMenu
$(document).mouseup(function(e){
	var container = $('.dropdown');

	if (!container.is(e.target)
		&& container.has(e.target).length === 0) {
			$('.dropdown').slideUp('fast', function(){
				$('.dropdown-area i').removeClass('ss-navigateup').addClass('ss-navigatedown');
			});
		}
});

